    return '  ' + date.getHours() + ':' + ('0' + date.getMinutes()).slice(-2) + ':' + ('0' + date.getSeconds()).slice(-2) + '  ';
});
let series1 = msg.payload.map(item => item.high_cell_resistance);

msg.payload = [
    {
        "series": ["High Cell Resistance"],
        "data": [series1],
        "labels": timestamps
    }
];

return msg;
